import React from 'react';
import styles from './Navbar.module.css';

const Navbar = () => {
let menu = [
  'alina'
]
  const a = true
  if (a === true) {
    menu = [
      'News Feed',
      'Inbox',
      'My Pages',
      'Friends',
      'Images',
      'Videos',
      'Messages',
      'Notifications',
      'People',
      'Nearby',
      'Insights',
      'Logout',
    ];
    return menu
  }
  // const menu = [
  //   'News Feed',
  //   'Inbox',
  //   'My Pages',
  //   'Friends',
  //   'Images',
  //   'Videos',
  //   'Messages',
  //   'Notifications',
  //   'People',
  //   'Nearby',
  //   'Insights',
  //   'Logout',
  // ];
  return (
    <nav className={styles.nav}>
      <div className={styles.widget}>Shortcuts</div>
      {menu.map((item) => (
        <div className={styles.menu}>{item}</div>
      ))}
    </nav>
  );
};
export default Navbar;
